import React from "react";

export const MainPage = () => {
  return (
    <div className="vh-100">
      <div className="row">
        <div className="col-lg-3 col-md-6 col-sm-12">
            <div className="cardBox peach-gradient"></div>
        </div>

        <div className="bg-info col-lg-3 col-md-6 col-sm-12">2</div>

        <div className="bg-primary col-lg-3 col-md-6 col-sm-12">3</div>

        <div className="bg-light col-lg-3 col-md-6 col-sm-12">4</div>
      </div>
      <div class="col-md-3 mb-4">
      <div class="peach-gradient bg-danger color-block mb-3 mx-auto rounded-circle z-depth-1"></div>
      <h5 class="mb-0">peach-gradient</h5>
    </div>
      {/* <div className="col-12">22222222</div>
      <div className="col-12">33333333</div> */}
    </div>
  );
};
